import React from 'react';
import './App.css';

const  App = () => {
  return (
    <div className="App">
      <ul>
        <li>ХЕР</li>
        <li>ХЕР ТЕБЕ</li>
        <li>ЕЩЕ ХЕР ТЕБЕ</li>
        <li>ИДИ НА ХЕР</li>
      </ul>
    </div>
  );
}

export default App;
